Путь к примирению безусловно есть. Записывайте, айдаровцы, рецепт:
1) берёте отрезок верёвки 8-ки или большего диаметра (но не больше 12-шки, 
а то плохо гнётся);
2) берёте кусок хозяйственного мыла;
3) берёте табуретку и ставите её под подвес достаточной прочности, чтобы 
выдержать 150 кг, и высотой 3-4 метра. Сук дуба или осины, крюк для люстры 
- подойдут;

дальше писать или сами поняли?﻿
